import React from "react";
import { Row, Col, Drawer, Form, InputNumber, Input } from "antd";
const ReservationDrawer = ({ visible, onClose }) => {
  return (
    <Drawer
      title="Reserv place"
      visible={visible}
      closable={false}
      placement="bottom"
      onClose={onClose}
    >
      <Form hideRequiredMark>
        <Row>
          <Col span={6}>
            <Form.Item
              label="Table_number"
              name="table_number"
              rules={[{ required: true, message: "Enter tabel Number" }]}
            >
              <InputNumber className="w-100" />
            </Form.Item>
          </Col>
          <Col span={5}>
            <Form.Item
              label="Customer Name"
              name="customer_name"
              rules={[{ required: true, message: "Enter Customer name" }]}
            >
              <Input />
            </Form.Item>
          </Col>
          <Col></Col>
        </Row>
      </Form>
    </Drawer>
  );
};

export default ReservationDrawer;
